import React from "react";

const FilterSelect = () => {
  return (
    <React.Fragment>
      <div>
        <select>
          <option value="all"></option>
          <option value="active"></option>
          <option value="archived"></option>
        </select>
      </div>
    </React.Fragment>
  );
};

export default FilterSelect;
